import React from "react";
import Overview from "../Overview/Overview";
import { motion } from "framer-motion";
function Home() {
  return (
    <motion.div animate={{ x, y, rotate }}
    transition={{ type: "spring" }}>
      <Overview />
    </motion.div>
  );
}

export default Home;
